const Posts = () => {
  const [blogposts, setBlogposts] = useState()

  useEffect(() => {
    console.log('Hello')
  })
  return (
    <div>
      <h2>Blog Posts:</h2>
      {blogposts.map((blogpost) => (
        <div className='blogposts' key={blogpost}>
          <Row>
            <Col>{blogpost.date}</Col>
            <Col>{blogpost.name}</Col>
            <Col>{blogpost.content}</Col>
          </Row>
        </div>
      ))}
    </div>
  )
}

export default Posts
